import "./style.css";

const Footer = () => {
  return (
    <footer>

      <a
        href="https://www.linkedin.com/in/prakhar-goel-40a86b19b/"
        target="_blank"
      >
        <img
          src="https://cdn2.iconfinder.com/data/icons/social-media-with-original-colors/256/icon-linkedin.png"
          alt="LinkIn-icon"
        />
      </a>

      <a
        href="https://github.com/prakharg07"
        target="_blank"
      >
        <img
          src="https://image.flaticon.com/icons/png/512/25/25231.png"
          alt="Github-icon"
        />
      </a>

    </footer>
  );
};

export default Footer;
